import React from 'react';
import { View, StyleSheet } from 'react-native';

function CharacterWindow(props) {
    return (
        <Text>
            Hello World!
        </Text>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
      },
})

export default CharacterWindow;
